(27, '1. Do 10 push ups on the roof of any car\r\n2. Say \"challe\" after you do each push up\r\n3. Record a video of this process\r\n4. Upload the video on Tik-Tok with hashtag #Challe\r\n5. Send the link of this video here in Challe app in \"provide the proof\" section.', 50, 4, NULL, NULL, 141, 1, '2024-05-24 06:44:58', '2024-08-29 18:03:57'),
(28, '1. Shake hand with 3 strangers in the crowded street\r\n2. Instead of Hello, say Challe and smile, while shaking a hand\r\n3. Record a video\r\n4. Upload it on Tiktok with this hashtag: #Challe\r\n5. Send the link of this video here in Challe app in \"provide the proof\" section.', 10, 3, NULL, NULL, 141, 1, '2024-05-24 09:41:36', '2024-08-29 18:52:05'),
(97, '1. Balance a pillow on your head (without holding it with hands) and squat 5 times without dropping it.\r\n2. Say \"Challe\" after each squat.\r\n3. Record a video of the entire process.\r\n4. Upload the video on TikTok with hashtag #Challe\r\n5. Send the link of this video here in Challe app in \"provide the proof\" section.', 10, 3, NULL, NULL, 141, 1, '2024-06-27 15:02:22', '2024-08-29 18:52:44'),
(98, '1. Gather 5 pairs of socks and a laundry basket.\r\n2. Stand approximately 3 meters away and try to toss each pair into the basket 3 times straight. After every toss, say ‘’Challe\"\r\n3. Record a video of the entire process.\r\n4. Upload the video on TikTok with hashtag #Challe\r\n5. Send the link of this video here in Challe app in \"provide the proof\" section.', 50, 4, NULL, NULL, 141, 1, '2024-06-27 15:04:55', '2024-08-29 18:53:01'),
(99, '1. Throw a piece of popcorn (at least 10 times) into the air and try to catch it in your mouth while standing on one leg.\r\n2. If you miss, you have to say \"Challe\" and try again until you catch it successfully.\r\n3. Record a video of the entire process, including the fails.\r\n4. Upload the video on TikTok with hashtag #Challe\r\n5. Send the link of this video here in Challe app in \"provide the proof\" section.', 100, 5, NULL, NULL, 141, 1, '2024-06-27 15:09:14', '2024-08-29 18:53:24'),
(100, '1. Spin around in place 10 times to make yourself dizzy. Say Challe after every spin\r\n2. After spinning, try to pop a balloon by sitting on it. (Balloon must be at least 5 meters away from spinning place)\r\n3. Record a video of the entire process, including the fails.\r\n5. Upload the video on TikTok with hashtag #Challe\r\n6. Send the link of this video here in Challe app in \"provide the proof\" section.', 100, 5, NULL, NULL, 141, 1, '2024-06-27 15:24:37', '2024-08-29 18:53:44'),
(101, '1. Balance a half-full water bottle on your head and do 10 squats without dropping it.\r\n2. Say \"Challe\" after each squat.\r\n3. If the bottle falls, start over from the beginning.\r\n4. Record a video of the entire process, including any fails.\r\n5. Upload the video on TikTok with hashtag #Challe\r\n6. Send the link of this video here in Challe app in \"provide the proof\" section.', 100, 5, NULL, NULL, 141, 1, '2024-06-27 15:26:02', '2024-08-29 18:54:10'),
(102, '1. Jiggle balloon in the air using only your head 10 times\r\n2. Say \"Challe\" after each hit\r\n3. If the balloon touches the ground, start over from the beginning.\r\n4. Record a video of the entire process, including any fails.\r\n5. Upload the video on TikTok with hashtag #Challe.\r\n6. Send the link of this video here in Challe app in \"provide the proof\" section.', 50, 4, NULL, NULL, 141, 1, '2024-06-27 15:30:48', '2024-08-29 18:54:20'),
(103, 'Challenge Description:\r\n\r\n	1.	Water Bottle Flip:\r\n	•	you must successfully flip a water bottle so that it lands upright 5 times in a row.\r\n	2.	Call Out:\r\n	•	After each successful flip, say “Challe.”\r\n	3.	Recording:\r\n	•	ask a friend to record a video of the entire process, including any failed attempts.\r\n	4.	Upload:\r\n	•	Send the link of this video here in Challe app in \"provide the proof\" section.', 1000, 7, NULL, NULL, 141, 1, '2024-06-27 15:37:56', '2024-08-29 18:54:44'),
(104, '1.	Put on a blindfold and toss a coin into the air, then catch it, 3 times in a row.\r\n	2.	Say “Challe” after each successful toss.\r\n	3.	Record a video of the entire process, including any failed attempts.\r\n	4.	Upload the video on TikTok with the hashtag #Challe.\r\n	5.	Send the link of this video here in Challe app in \"provide the proof\" section.', 50, 4, NULL, NULL, 141, 1, '2024-06-27 15:55:57', '2024-08-29 18:56:08'),
(105, '1. take any book\r\n2. place it on your head 10 times\r\n3. say \"challe\" after placing a book on your head each time\r\n4. record a video and upload it on tiktok\r\n5. Send the link of this video here in Challe app in \"provide the proof\" section.', 10, 3, NULL, NULL, 141, 1, '2024-06-27 16:02:44', '2024-08-29 18:56:34'),
(106, '1.	Using a straw, transfer 10 mini marshmallows from one plate to another by sucking them up through the straw.\r\n	2.	Say “Challe” after transferring every 10 marshmallows (after each transfer)\r\n	3.	Record a video of the entire process, including any failed attempts.\r\n	4.	Upload the video on TikTok with the hashtag #Challe.\r\n	5.	Send the link of this video here in Challe app in \"provide the proof\" section.', 100, 5, NULL, NULL, 141, 1, '2024-06-27 16:05:32', '2024-08-29 18:56:55'),
(107, '1. Place a cookie on your forehead.\r\n2. Without using your hands, move the cookie from your forehead to your mouth by only moving your face muscles.\r\n3. Say \"Challe\" once the cookie is in your mouth.\r\n4. Ask a friend to record a video of you and the entire process, including any failed attempts.\r\n5. Upload the video on TikTok with the hashtag #Challe.\r\n6. Send the link of this video here in Challe app in \"provide the proof\" section.', 100, 5, NULL, NULL, 141, 1, '2024-06-27 16:10:05', '2024-08-29 18:57:08'),
(108, '1. Balance a spoon on the edge of a table and flip it to try to catch it in a cup. (3 times)\r\n2. Say \"Challe\" after each successful catch.\r\n3. If you miss, you must do a squat\r\n4. Record a video of the entire process, including any fails (ask a friend)\r\n5. Upload the video on TikTok with the hashtag #Challe.\r\n6. Send the link of this video here in Challe app in \"provide the proof\" section/ or send this link to email: ChalleCorporation@gmail.com', 100, 5, NULL, NULL, 141, 1, '2024-06-27 16:13:16', '2024-08-27 13:28:16'),
(109, '1. Go to a crowded public place.\r\n2. Start singing a well-known song loudly for at least 20 seconds.\r\n3. Say \"Challe\" at the end of your performance\r\n4. Record a video of the entire process, including any reactions from the crowd. (Ask a friend)\r\n5. Upload the video on TikTok with the hashtag #Challe.\r\n6. Send the link of this video here in Challe app in \"provide the proof\" section.', 1000, 7, NULL, NULL, 141, 1, '2024-06-27 16:22:48', '2024-08-29 18:57:35'),
(110, '1. Go to a crowded place.\r\n2. Freeze in a funny pose for 60 seconds without moving.\r\n3. Say \"Challe\" once the 60 seconds are up.\r\n4. Record a video of the entire process, including any reactions from the crowd. (Ask a friend)\r\n5. Upload the video on TikTok with the hashtag #Challe.\r\n6. Send the link of this video here in Challe app in \"provide the proof\" section.', 100, 5, NULL, NULL, 141, 1, '2024-06-27 16:25:58', '2024-08-29 18:57:55'),
(111, '1.	Go to a crowded public place\r\n2.	Carry a banana and pretend it’s your phone.\r\n3.	Approach random people and have a serious conversation on your “banana phone.”\r\n4.	Say “Challe” during conversation\r\n5.	prank at least 1 people\r\n6.	Record a video of the entire process (maximum 30 seconds long)\r\n7.	Upload the video on TikTok with the hashtag #Challe.\r\n8.	Send the link of this video here in Challe app in \"provide the proof\" section.', 100, 5, NULL, NULL, 141, 1, '2024-06-27 16:37:41', '2024-08-29 18:58:21'),
(112, '1.	Go to a crowded public place\r\n	2.	Challenge yourself to do as many push-ups as you can in 30 seconds.\r\n	3.	While doing push-ups, shout out funny phrases like “I’m getting stronger!” or “Feel the burn!” after each push-up.\r\n	4.	Say “Challe” at the end of the challenge.\r\n	5.	ask a friend to record a video of the entire process, including the reactions from the crowd.\r\n	6.	Upload the video on TikTok with the hashtag #Challe.\r\n	7.	Send the link of this video here in Challe app in \"provide the proof\" section.', 1000, 7, NULL, NULL, 141, 1, '2024-06-27 16:45:54', '2024-08-29 18:59:14'),
(129, '1. smile and clap your hands for 10 seconds\r\n2. say \"challe\" after you finish\r\n3. record a video of this process and upload it on tiktok\r\n4. make a hashtag #challe on the video\r\n5. Send the link of this video here in Challe app in \"provide the proof\" section.', 10, 3, NULL, NULL, 141, 1, '2024-08-27 09:15:51', '2024-08-29 19:00:44'),
(131, '1. do 5 push ups on the roof of any car\r\n2. say \"challe\" after every push up\r\n3. record a video of the process and upload it on tiktok WITH HASHTAG #challe\r\n4. Send the link of this video here in Challe app in \"provide the proof\" section.\r\n5. Dont ever delete video, we will disqualify you from the app if you delete it', 10, 3, NULL, NULL, 141, 1, '2024-08-27 13:11:10', '2024-08-29 19:01:11'),
