(147, '1. Blindfold yourself and try to toss a crumpled paper ball into a small bin or basket 2 times in a row from a distance of at least one meter.\r\n2. Say \"Challe\" after each successful toss.\r\n3. If you miss, start over from the beginning.\r\n4. Record a video of the entire process.\r\n5. Upload the video on TikTok with the hashtag #Challe.\r\n6. Send the link to this video here in the Challe app in the \"provide the proof\" section.\r\n7. Don\'t ever delete the video. Otherwise, you will be disqualified from the app.', 10, 3, NULL, NULL, 141, 1, '2024-08-28 14:01:29', '2024-08-29 19:02:44'),
